import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import IconButton from '@mui/material/IconButton';
//import MenuIcon from '@mui/icons-material/Menu';
import NotificationsNoneIcon from '@mui/icons-material/NotificationsNone';

import {BrowserRouter as Route, Link} from 'react-router-dom';


import {Navbar, Container, Nav, NavDropdown} from 'react-bootstrap';

import 'bootstrap/dist/css/bootstrap.css';
export default function NavBar(){
  return(
  <Navbar expand="lg" style={{backgroundColor:'black', color:'white'}}>
  <Container>
    <Navbar.Brand href="#home" style={{color:'white'}}>React-Bootstrap</Navbar.Brand>
    <Navbar.Toggle aria-controls="basic-navbar-nav" />
    <Navbar.Collapse id="basic-navbar-nav" style={{color:'white'}}>
      <Nav className="me-auto">
        <Nav.Link href="#home" style={{color:'white'}}>Home</Nav.Link>
        <Nav.Link href="#link" style={{color:'white'}}>Link</Nav.Link>
        <NavDropdown title="Dropdown" id="basic-nav-dropdown">
          <NavDropdown.Item href="#action/3.1" style={{color:'white'}}>Action</NavDropdown.Item>
          <NavDropdown.Item href="#action/3.2" style={{color:'white'}}>Another action</NavDropdown.Item>
          <NavDropdown.Item href="#action/3.3" style={{color:'white'}}>Something</NavDropdown.Item>
          <NavDropdown.Divider />
          <NavDropdown.Item href="#action/3.4"style={{color:'white'}} >Separated link</NavDropdown.Item>
        </NavDropdown>
      </Nav>
    </Navbar.Collapse>
  </Container>
</Navbar>
  )
}
